// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./GoodLottery.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

contract GoodLotterNFT is GoodLottery {
    IERC721 public nftToken;
    uint256 public tokenId;
    address public tokenOwner;

    event ReceiveToken(address nftToken, address user, uint token);

   constructor(
        ComptrollerInterface _comptroller,
        IERC20 _token,
        uint32 _goodId,
        uint256 _goodValue,
        uint256 _maintenanceFee,
        uint256 _publishTime,
        uint256 _lockedTime,
        string memory _goodHash,
        address _nftAddress,
        uint256 _tokenId
    ) GoodLottery(_comptroller, _token, _goodId, _goodValue, _maintenanceFee, _publishTime, _lockedTime, _goodHash) {
        nftToken = IERC721(_nftAddress);
        stage = Stage.INIT;
        tokenId = _tokenId;
    }

    function publishToMarket() public {
        require(nftToken.getApproved(tokenId) == address(this));
        address marketOwner = comptroller.owner();

        transferOwnership(marketOwner);

        address[] memory goods = new address[](1);
        goods[0] = address(this);

        uint[] memory resp = comptroller.publishGood(goods);

        require(resp[0] == 0, "publish failed");
    }

    function payToWinner(uint winnerValue) internal override returns (Error) {
        token.transfer(tokenOwner, winnerValue);
        nftToken.transferFrom(tokenOwner, winner, tokenId);
        return Error.NO_ERROR;
    }
}
